import React from 'react';
import { Link } from 'react-router-dom';
import { Grid, makeStyles, TextField, Button } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
	root: {
		height: '100vh',
		width: '100%',
		backgroundColor: '#bbbbbb',
		overflow: 'auto',
		display: 'flex',
	},
	leftContainer: { height: '100vh', width: '100%', backgroundColor: '#bbbbbb' },
	rightContainer: {
		height: '100vh',
		width: '100%',
		backgroundColor: '#ffffff',
	},
	loginRow: { paddingRight: theme.spacing(2) },
}));

const Landing = (props) => {
	const classes = useStyles();

	return (
		<Grid className={classes.root} container direction="row">
			<Grid item xs={6}>
				<Grid className={classes.leftContainer} container direction="column">
					Left side
				</Grid>
			</Grid>
			<Grid item xs={6}>
				<Grid className={classes.rightContainer} container direction="column">
					<Grid
						className={classes.loginRow}
						justify="center"
						container
						direction="row"
					>
						<Grid item>
							<TextField label="username"></TextField>
						</Grid>
						<Grid item></Grid>
						<TextField type="password" label="password"></TextField>
						<Button>Log In</Button>
					</Grid>
				</Grid>
			</Grid>
		</Grid>
	);
};

export default Landing;
